package com.fr.bi.cal.analyze.cal.index.loader;import com.fr.bi.cal.analyze.cal.store.GroupKey;import com.fr.bi.conf.report.widget.field.dimension.filter.DimensionFilter;import com.fr.general.ComparatorUtils;import java.util.Set;/** * Created by Hiram on 2015/1/11. */class FilterGroupValueIndexKey {    Set<DimensionFilter> resultFilterSet;    Set<GroupKey> groupKeySet;    public FilterGroupValueIndexKey(Set<DimensionFilter> resultFilterSet, Set<GroupKey> groupKeySet) {        this.resultFilterSet = resultFilterSet;        this.groupKeySet = groupKeySet;    }    public Set<DimensionFilter> getResultFilterSet() {        return resultFilterSet;    }    public void setResultFilterSet(Set<DimensionFilter> resultFilterSet) {        this.resultFilterSet = resultFilterSet;    }    public Set<GroupKey> getGroupKeySet() {        return groupKeySet;    }    public void setGroupKeySet(Set<GroupKey> groupKeySet) {        this.groupKeySet = groupKeySet;    }    @Override    public boolean equals(Object o) {        if (this == o) {            return true;        }        if (!(o instanceof FilterGroupValueIndexKey)) {            return false;        }        FilterGroupValueIndexKey that = (FilterGroupValueIndexKey) o;        if (groupKeySet != null ? !ComparatorUtils.equals(groupKeySet, that.groupKeySet) : that.groupKeySet != null) {            return false;        }        if (resultFilterSet != null ? !ComparatorUtils.equals(resultFilterSet, that.resultFilterSet) : that.resultFilterSet != null) {            return false;        }        return true;    }    @Override    public int hashCode() {        int result = resultFilterSet != null ? resultFilterSet.hashCode() : 0;        result = 31 * result + (groupKeySet != null ? groupKeySet.hashCode() : 0);        return result;    }}